There are 12 individual components for this one dessert. In a full service pastry shop I could execute that in under three hours. In my modest shop itâ€™s a three day process and never, ever am I working one item to completion in one go. 

The inserts - cremeux and cake - along with the pastry, buttercream and garnish are prepared and stored or frozen day one. Day two is unmolding the inserts and filling the second mold with mousse and inserts before freezing. Day three is macarons, cutting and baking the base, unmolding and glazing the mousse, along with assembling the finished piece. 

I am sharing much more detail than anyone would want or need to illustrate a point, but there are many, many more layers to that point. 

Today a customer asked about what we did with our three day weekend. Jackie was very kind and touched on our schedule and the extra efforts we were going through with remote learning for our children and some of the challenges and limitations that Covid has created. 

That one dessert demonstrates our belief in the products we offer. When you look at the counter and case every one of those items requires commitment and concentration. Each item is about the effort and challenge of creating something we believe in. If we offer it, itâ€™s made in-house, by hand. Itâ€™s made with simple, common ingredients that we have confidence in serving. This takes a lot of time and old fashioned grit. We wouldnâ€™t have it another way. 

While we have been blessed with great customers and community support, we are still growing. Hopefully after the New Year we will be able to grow a little more, but for now the days are long and the sacrifices many. An average week for us is in excess of eighty hours a piece during an average week. Just because the storefront isnâ€™t open doesnâ€™t mean weâ€™re not at it. 

If you have a belief, trust in providence, hard work, and most importantly yourself. Or in our case each other. 

